// src/components/ClaudeGraphic.js
import React from 'react';
import { Canvas } from '@react-three/fiber';
import { OrbitControls } from '@react-three/drei';

const ClaudeGraphic = () => (
  <Canvas style={{ height: '300px' }}>
    <ambientLight intensity={0.5} />
    <OrbitControls />
    {/* Create connected dots to symbolize a neural network */}
    {[...Array(10)].map((_, i) => (
      <mesh position={[Math.sin(i), Math.cos(i), Math.random() * 2]}>
        <sphereGeometry args={[0.1, 32, 32]} />
        <meshStandardMaterial color="purple" />
      </mesh>
    ))}
  </Canvas>
);

export default ClaudeGraphic;
